function sendAjaxForm(r,t,e){$.ajax({url:e,type:"POST",dataType:"html",data:$(t).serialize(),success:function(r){result=$.parseJSON(r),$(document).mouseup(function(r){var t=$(".form__result");t.is(r.target)||0!==t.has(r.target).length||t.removeClass("form__result--show")}),$(".form__result").html("Thank You!").addClass("form__result--show")},error:function(r){$(".form__result").html("Error")}})}